import React, {useEffect,useState} from 'react'
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { useHistory } from 'react-router-dom';
import {GetTimetable,searchByDate} from '../../../reducer/crmRedux/action'

const Admin = () => {
  let state = useSelector((state) => state.timetableReducer);
  const dispatch = useDispatch();
  const [date, getDate] = useState({
    from:'',
    to:''
  })
  console.log(date)
  // get data from back
  useEffect(() => {
    dispatch(GetTimetable())
  }, [])

  // searching table

  const Searching = (e) =>{
    e.preventdefault()
  }

  return (
  <>
  {
    state ? (
      <div className='container main-admin-page' >
        <div className="container-fluid">
          <div className="row">
          <div className="col-md-12">
            <form action="" className='get-date'>
            <label htmlFor="date">from:
            <input type="datetime-local" id="date" name="date"

                onChange={(e) =>{
                  getDate({
                    ...date ,from: e.target.value
                  })
                }}
              />
              </label>
              <label htmlFor="date">to:
                <input type="datetime-local" id="date" name="date"

                  onChange={(e) =>{
                    getDate({
                      ...date,to:e.target.value
                    })
                  }}
                />
              </label>
              <button> search </button>
            </form>

          </div>
          {
            state.map((timetable,index) =>{
              const {
                student_Name,
                teacher_Name,
                class_Name,
                date,
                _id,
                class_Comment
              } = timetable
                const time = new Date(date)
                const minute = time.getMinutes()
                const hour = time.getHours()
                const day = time.getDay()
                const month = time.getMonth()
                const year = time.getFullYear()

              return(

                <div key={index} className="col-md-6">
                  <div className='table-box' >
                    <p> <b>teacher:</b>  {teacher_Name} </p>
                    <p> <b>student:</b>  {student_Name} </p>
                    <p> <b>class:</b>  {class_Name} </p>
                    <p> <b>class information:</b> {class_Comment} </p>
                    <p> <b>date:</b> <span>{`${year} ${month} ${day} ${hour}:${minute}`} </span></p>
                    <div className='btn-div'>
                      <button >
                        confirm class
                      </button>
                      <button >
                        gancel class
                      </button>
                    </div>
                  </div>
                </div>
              )
            })
          }

          <Link to="/Create">
            <button className='create-button'>
              create
            </button>
          </Link>
          </div>
        </div>
      </div> 
    ):(
      <p>wait</p>
    )
  }

  </>

  )
}

export default Admin
